INSERT INTO "master_garment_part" ("create_time", "update_time", "create_by_id", "update_by_id", "system_create_time", "system_update_time", "active", "english", "french_canadian", "spanish_mx", "spanish_latin", "russian", "french", "arabic", "japanese", "hebrew", "turkish", "polish", "chinese_simple", "bahasa", "german", "dutch", "hindi") VALUES ('2014-4-9 17:43:18.979', '2014-4-9 17:43:18.979', 1, 1, '2014-4-9 17:43:18.979', '2014-4-9 17:43:18.979', 0, 'WARNING: PLASTIC BAGS CAN BE DANGEROUS. KEEP AWAY FROM BABIES AND CHILDREN. DO NOT USE IN CRIBS, BEDS, CARRIAGES OR PLAYPENS. THE THIN FILM MAY CLING TO NOSE AND MOUTH AND PREVENT BREATHING. THIS BAG IS NOT A TOY.', 'AVERTISSEMENT : LES SACS EN PLASTIQUE PEUVENT ÊTRE DANGEREUX. TENIR HORS DE PORTÉE DES BÉBÉS ET DES ENFANTS. NE PAS UTILISER DANS LES BERCEAUX, LES LITS, LES POUSSETTES OU LES PARCS. LE MINCE FILM DE PLASTIQUE PEUT RECOUVRIR LE NEZ ET LA BOUCHE DE L''ENFANT ET L''EMPÊCHER DE RESPIRER. CE SAC N''EST PAS UN JOUET.', 'ADVERTENCIA: LAS BOLSAS PLÁSTICAS PUEDEN SER PELIGROSAS. MANTENER ALEJADAS DE BEBÉS Y NIÑOS. NO UTILIZAR EN CUNAS, CAMAS, CARRIOLAS NI CORRALES PARA BEBÉS. LA FINA PELÍCULA PUEDE ADHERIRSE A LA NARIZ Y LA BOCA Y OBSTRUIR LA RESPIRACIÓN. ESTA BOLSA NO ES UN JUGUETE.', 'ADVERTENCIA: LAS BOLSAS PLÁSTICAS PUEDEN SER PELIGROSAS. MANTENER ALEJADAS DE BEBÉS Y NIÑOS. NO UTILIZAR EN CUNAS, CAMAS, COCHES DE NIÑOS NI EN CORRALITOS. LA PELÍCULA FINA PUEDE ADHERIRSE A LA NARIZ Y LA BOCA Y OBSTRUIR LA RESPIRACIÓN. ESTA BOLSA NO ES UN JUGUETE.', 'ВНИМАНИЕ! ПЛАСТИКОВЫЕ ПАКЕТЫ МОГУТ ПРЕДСТАВЛЯТЬ ОПАСНОСТЬ. БЕРЕЧЬ ОТ ДЕТЕЙ. НЕ ИСПОЛЬЗОВАТЬ В ДЕТСКИХ КОЛЫБЕЛЯХ, КРОВАТКАХ, КОЛЯСКАХ И МАНЕЖАХ.  ТОНКАЯ ПЛЕНКА МОЖЕТ НАЛИПНУТЬ НА НОС ИЛИ РОТ И ВОСПРЕПЯТСТВОВАТЬ ДЫХАНИЮ. НЕ ИСПОЛЬЗОВАТЬ ПАКЕТ КАК ИГРУШКУ.', 'ATTENTION : LES SACS PLASTIQUES PEUVENT ÊTRE DANGEREUX. GARDER HORS DE PORTÉE DES BÉBÉS ET DES ENFANTS. NE PAS UTILISER DANS LES BERCEAUX, LITS, LANDAUS OU PARCS DE JEUX. CE PLASTIQUE ULTRA FIN PEUT COUVRIR LE NEZ ET LA BOUCHE ET ENTRAVER LA RESPIRATION. CE SAC N''EST PAS UN JOUET.', 'تحذير: قد تشكل الحقائب البلاستيكية خطورة. تُحفظ بعيدًا عن متناول الرضّع والأطفال. يحظر استخدامها في أسرّة الأطفال أو الكبار، أو عربات النقل أو رياض الأطفال. قد تلتصق الطبقة الرقيقة للحقيبة البلاستيكية في الأنف والفم وتمنع التنفس. هذه الحقيبة ليست لعبة.', '警告: ビニール袋は危険性があります。 幼児や子どもの手の届かない所に置いてください。 ベビーベッド、ベッド、ベビーカー、ベビーサークルで使用しないでください。 薄いフィルムが鼻や口をふさいで窒息する危険があります。 この袋はおもちゃではありません。', 'אזהרה: שקיות ניילון עלולות להיות מסוכנות. יש להרחיק מתינוקות וילדים. אין להשתמש בעריסות, במיטות, בעגלות או בלולי-פעוטות. סרט פלסטי דק זה עלול להיצמד לאפם ולפיהם, ולגרום למחנק. שקית זו אינה משחק.', 'UYARI: PLASTİK POŞETLER TEHLİKELİ OLABİLİR. BEBEK VE ÇOCUKLARDAN UZAK TUTUNUZ. BEŞİK, YATAK, BEBEK ARABASI VEYA OYUN PARKINDA KULLANMAYINIZ. İNCE TABAKA BURUN VE AĞZA YAPIŞABİLİR VE NEFES ALMAYI ENGELLEYEBİLİR. BU POŞET BİR OYUNCAK DEĞİLDİR.', 'OSTRZEŻENIE PLASTIKOWE TORBY MOGĄ BYĆ NIEBEZPIECZNE. PRZECHOWYWAĆ W MIEJSCU NIEDOSTĘPNYM DLA NIEMOWLĄT I DZIECI. NIE STOSOWAĆ W KOŁYSKACH, ŁÓŻECZKACH, WÓZKACH DZIECIĘCYCH ANI KOJCACH. CIENKA FOLIA MOŻE PRZYLEGAĆ DO NOSA I UST I UNIEMOŻLIWIĆ ODDYCHANIE. TA TORBA NIE JEST ZABAWKĄ.', '警告： 塑料袋可能十分危险。 请远离婴儿和儿童。 请勿在婴儿床、床、手推车或婴儿围栏中使用。 薄膜可能紧贴口鼻，阻碍呼吸。 请勿将此袋当作玩具。', 'PERINGATAN: TAS PLASTIK BISA BERBAHAYA. JAUHKAN DARI BAYI DAN ANAK-ANAK JANGAN GUNAKAN DI TEMPAT TIDUR BAYI, KASUR, KERETA, ATAU KOTAK TEMPAT MAIN ANAK. FILM TIPIS BISA MELEKAT KE HIDUNG DAN MULUT DAN MENGHAMBAT PERNAPASAN. TAS INI BUKAN MAINAN ANAK-ANAK.', 'WARNUNG: PLASTIKTÜTEN KÖNNEN GEFÄHRLICH SEIN. HALTEN SIE PLASTIKTÜTEN VON KLEINKINDERN UND KINDERN FERN. VERWENDEN SIE SIE NICHT IN KINDERBETTEN, BETTEN, KINDERWAGEN ODER LAUFGITTERN. DIE DÜNNE FOLIE KANN AN NASE UND MUND HAFTEN BLEIBEN UND DAS ATMEN UNMÖGLICH MACHEN. DIESE TÜTE IST KEIN SPIELZEUG.', 'WAARSCHUWING: PLASTICZAKKEN KUNNEN GEVAARLIJK ZIJN. BUITEN BEREIK VAN BABY''S EN KINDEREN HOUDEN. NIET GEBRUIKEN IN WIEGEN, BEDDEN, KINDERWAGENS OF BOXEN. HET DUNNE FOLIE KAN OP MOND EN NEUS BLIJVEN KLEVEN EN DE ADEMHALING BELEMMEREN. DEZE ZAK IS GEEN SPEELGOED.', 'चेतावनी: प्लास्टिक बैग खतरनाक हो सकते हैं। शिशुओं और बच्चों से दूर रखें। बच्चे के बिछौनों, बिस्तरों, वाहकों या प्लेपैन में इस्तेमाल न करें। पतली फिल्म नाक और मुँह से चिपक सकती है और साँस लेने में रुकावट डाल सकती है। यह बैग कोई खिलौना नहीं है।');
